// CreateDoctorSchedule.js
import React, { useState } from 'react';

const CreateDoctorSchedule = ({ onCreateSchedule }) => {
  const [scheduleData, setScheduleData] = useState({
    Date_DateOnly: '',
    StartTime_TimeOnly: '',
    EndTime_TimeOnly: '',
  });

  const handleChange = (e) => {
    setScheduleData({
      ...scheduleData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // Validate and call the provided onCreateSchedule function with the schedule data
    if (typeof onCreateSchedule === 'function') {
      onCreateSchedule(scheduleData);
    } else {
      console.error('onCreateSchedule is not a function');
    }
  };

  return (
    <div>
      <h2>Create Doctor Schedule</h2>
      <form onSubmit={handleSubmit}>
        {/* Form fields and other elements */}
        <button type="submit">Create Schedule</button>
      </form>
    </div>
  );
};

export default CreateDoctorSchedule;
